window.bookSummaryJSON = "<p>After participating in the empire's vassal war, Matt, Liz, and Aster now have a fire nipping after their heels. Or rather, their new manager, Luna. And she demands their best at all times, or she will drive them off The Path of Ascension.</p> <p>With the Tier-10 tournament looming in front of them, the gang is going to have to dig deep if they want to continue on the path, but Luna isn't the only one who has plans.&nbsp;</p> <p>Can Matt, Liz, and Aster survive the machinations of a Tier-40 who has created several Ascenders before? Or will they simply be another statistic on The Path?</p> <p><b>Don't miss book four of this action-packed fantasy adventure that blends everything you love about LitRPG with </b><b><i>xianxia</i></b><b>.</b></p> <p><b>About the series:</b> This is a mix between LitRPG and <i>xianxia</i>. It's like a car that looks like a LitRPG with dungeons and skills, but the interior and engine are all <i>xianxia</i>. It features a magic system and progression system that are logically and internally consistent, as well as realistic fight scenes and a rational MC.</p>"; 
